import React, { useState, useEffect, Component } from "react";
import MaterialTable from "material-table";

import { authAxios } from "../../utils";
import { orderListURL } from "../../constants";

function Test2() {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    const fetchOrders = async () => {
      setLoading(true);
      const res = await authAxios.get(orderListURL);
      setOrders(res.data);
      setLoading(false);
    };

    fetchOrders();
  }, []);

  const columns = [
    { label: "Shop Name", id: "shop_name" },
    { label: "Total Amount", id: "total" },
    { label: "Data", id: "start_date" },
    { label: "Status", id: "order_status" }
  ];

  return (
    <MaterialTable
      title="One Detail Panel Preview"
      columns={columns}
      data={orders}
      detailPanel={orders => {
        return (
          <MaterialTable
            title="One Detail Panel Preview"
            columns={[
              { title: "Name", field: "name" },
              { title: "Surname", field: "surname" },
              { title: "Birth Year", field: "birthYear", type: "numeric" },
              {
                title: "Birth Place",
                field: "birthCity",
                lookup: { 34: "İstanbul", 63: "Şanlıurfa" }
              }
            ]}
            data={[
              {
                name: "Mehmet",
                surname: "Baran",
                birthYear: 1987,
                birthCity: 63
              },
              {
                name: "Zerya Betül",
                surname: "Baran",
                birthYear: 2017,
                birthCity: 34
              }
            ]}
          />
        );
      }}
    />
  );
}
export default Test2;
